import React, { useEffect, useState } from "react";
import { useCreateBookingMutation } from "../../redux/api/bookingApi";
import toast from "react-hot-toast";
import { useGetUsersQuery } from "../../redux/api/adminApi";
import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";

const AddBookingForm = ({ setShowForm, refetch }) => {
  const [form, setForm] = useState({
    user: "",
    fromPlace: "",
    toPlace: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    remarks: "",
    totalAmount: "",
  });

  const { data: users } = useGetUsersQuery();
  const { data: flightTypes } = useGetFlightTypesQuery();
  const [createBooking] = useCreateBookingMutation();

  const handleSubmit = async (e) => {
    e.preventDefault();

    // validation
    if (
      !form.user ||
      !form.fromPlace ||
      !form.toPlace ||
      !form.travelDate ||
      !form.travelTime ||
      !form.flightType ||
      !form.totalAmount
    ) {
      toast.error("Please fill all required fields");
      return;
    }

    try {
      const payload = {
        ...form,
        totalAmount: parseFloat(form.totalAmount),
      };

      await createBooking(payload).unwrap();
      toast.success("Booking created successfully");
      refetch();
      setShowForm(false);
    } catch (err) {
      toast.error("Failed to create booking");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="border p-3 mb-4 bg-light">
      <div className="row g-3">
        <div className="col-md-4">
          <select
            className="form-select"
            value={form.user}
            onChange={(e) => setForm({ ...form, user: e.target.value })}
            required
          >
            <option value="">Select Traveler</option>
            {users?.users?.map((u) => (
              <option key={u._id} value={u._id}>
                {u.name} ({u.email})
              </option>
            ))}
          </select>
        </div>

        <div className="col-md-4">
          <input
            className="form-control"
            placeholder="From Place"
            value={form.fromPlace}
            onChange={(e) => setForm({ ...form, fromPlace: e.target.value })}
            required
          />
        </div>

        <div className="col-md-4">
          <input
            className="form-control"
            placeholder="To Place"
            value={form.toPlace}
            onChange={(e) => setForm({ ...form, toPlace: e.target.value })}
            required
          />
        </div>

        <div className="col-md-4">
          <input
            type="date"
            className="form-control"
            value={form.travelDate}
            onChange={(e) => setForm({ ...form, travelDate: e.target.value })}
            required
          />
        </div>

        <div className="col-md-4">
          <input
            type="time"
            className="form-control"
            value={form.travelTime}
            onChange={(e) => setForm({ ...form, travelTime: e.target.value })}
            required
          />
        </div>

        <div className="col-md-4">
          <select
            className="form-select"
            value={form.flightType}
            onChange={(e) => setForm({ ...form, flightType: e.target.value })}
            required
          >
            <option value="">Select Flight Type</option>
            {flightTypes?.flightTypes?.map((f) => (
              <option key={f._id} value={f._id}>
                {f.name}
              </option>
            ))}
          </select>
        </div>

        <div className="col-md-4">
          <input
            type="number"
            className="form-control"
            placeholder="Total Amount"
            value={form.totalAmount}
            onChange={(e) => setForm({ ...form, totalAmount: e.target.value })}
            required
          />
        </div>

        <div className="col-md-8">
          <textarea
            className="form-control"
            rows="2"
            placeholder="Remarks"
            value={form.remarks}
            onChange={(e) => setForm({ ...form, remarks: e.target.value })}
          />
        </div>

        <div className="col-md-12 d-flex gap-2 mt-2">
          <button type="submit" className="btn btn-success">
            Submit Booking
          </button>
          <button
            type="button"
            className="btn btn-secondary"
            onClick={() => setShowForm(false)}
          >
            Cancel
          </button>
        </div>
      </div>
    </form>
  );
};

export default AddBookingForm;
